(function() {
  // 1. إعدادات الروابط (يجب تعديلها قبل الرفع)
  var checkUrl = "https://script.google.com/macros/s/AKfycbz4cGooZYP7IazR7HSreUib6nskouh4S6zUsBkt9RXzFRkNpNA_Ekq5lZKCcwO96wbPfA/exec"; // رابط Web App من Apps Script
  var developerUrl = "https://motawir-dzair.blogspot.com"; // رابط صفحتك للتحويل
  var currentDomain = window.location.hostname;

  // 2. دالة التحقق
  fetch(checkUrl + "?domain=" + currentDomain) 
// عادة الروابط لا تتأثر، لكن المشكلة الكبرى دائما في data.allowed
    .then(response => response.json())
    .then(data => {
      if (data['allowed'] === false) {
        // --- إجراءات الحظر ---
        document.querySelector("html").innerHTML = ""; // مسح الموقع
        
        var warningBox = document.createElement("div");
        warningBox.style.cssText = "position:fixed;top:0;left:0;width:100%;height:100%;background:#1a1a1a;color:#fff;display:flex;flex-direction:column;justify-content:center;align-items:center;z-index:9999999;font-family:sans-serif;text-align:center;";
        warningBox.innerHTML = "<h1 style='color:#e74c3c;font-size:2rem;margin-bottom:20px;'>نسخة غير مرخصة</h1>" +
                               "<p style='font-size:1.2rem;color:#ccc;'>يرجى شراء القالب من المصدر الرسمي.</p>";
        
        document.body.appendChild(warningBox);

        setTimeout(function() {
          window.location.href = developerUrl;
        }, 4000);
      }
    })
    .catch(err => {
      // اختياري: ماذا تفعل لو فشل الاتصال بالسيرفر؟
      // console.log("License check failed");
    });
})();
